import { Link } from 'react-router-dom';
import { useAuth } from '../AuthContext/AuthContext.js';
import { useState, useEffect } from 'react';
import axios from 'axios';

import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';

const CompNavbar = () => {
    const { logout } = useAuth();

    const user = JSON.parse(localStorage.getItem('userId'));
    const URI = "http://localhost:8000/users/"+user;
    const [users, setUsers] = useState("");

    useEffect(() => {
        const getUser = async () => {
            const res = await axios.get(URI);
            setUsers(res.data);
            console.log(res.data);
        }
        getUser();
    }, [URI]);

    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
            <div className="container-fluid">
                {user === null ? (
                    <>
                    <Link to ={'/'} className="navbar-brand">RecipeApp</Link>
                        <div className="collapse navbar-collapse" id="navbarNav">
                        </div>
                    </>
                ) : (
                    // <>
                    //     <Link to={'/dashboard'} className="navbar-brand">
                    //         RecipeApp
                    //     </Link>
                    //     <div className="collapse navbar-collapse" id="navbarNav">
                    //         <ul className="navbar-nav">
                    //             <li className="nav-item">
                    //                 <Link to={'/users'} className="nav-link">
                    //                     Usuarios
                    //                 </Link>
                    //             </li>
                    //             <li className="nav-item">
                    //                 <Link to={'/recipes'} className="nav-link">
                    //                     Recetas
                    //                 </Link>
                    //             </li>
                    //             <li className="nav-item">
                    //                 <Link to={'/users/' + user} className="nav-link">
                    //                     Recetas favoritas
                    //                 </Link>
                    //             </li>
                    //             <div className="btn-group">
                    //                 <button type="button" className="btn btn-danger dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                    //                     Action
                    //                 </button>
                    //                 <ul className="dropdown-menu">
                    //                     <li><p className="dropdown-item">{users.alias}</p></li>
                    //                     <li><hr className="dropdown-divider"/></li>
                    //                     <li>
                    //                         <button onClick={logout} className='dropdown-item'>Cerrar Sesi贸n</button>
                    //                     </li>
                    //                 </ul>
                    //             </div>
                                        
                                
                    //             <li className='nav-item dropdown'>
                    //                 <ul className="dropdown-menu">
                                        
                    //                     <li className="nav-item">
                    //                         <button onClick={logout}>Cerrar Sesi贸n</button>
                    //                     </li>
                    //                 </ul>
                    //             </li>
                    //         </ul>
                            
                    //     </div>
                    // </>

                    <>
      {[false, 'sm', 'md', 'lg', 'xl', 'xxl'].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
          <Container fluid>
            <Navbar.Brand href="#">Navbar Offcanvas</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Offcanvas
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">Home</Nav.Link>
                  <Nav.Link href="#action2">Link</Nav.Link>
                  <NavDropdown
                    title="Dropdown"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">
                      Another action
                    </NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#action5">
                      Something else here
                    </NavDropdown.Item>
                  </NavDropdown>
                </Nav>
                <Form className="d-flex">
                  <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                  />
                  <Button variant="outline-success">Search</Button>
                </Form>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
                )}
            </div>
        </nav>
    );
    
}

export default CompNavbar;
